import React from 'react';
import ReactDOM from 'react-dom';
import './my-style.css';
import Main from './components/Main';
import * as serviceWorker from './serviceWorker';
import { Provider } from 'react-redux';
import {createStore, applyMiddleware} from 'redux';
import parse from './reducers/reducers';
import {uriToJson} from './functions/helpers';
import {setRoute} from './actions/action';
import thunkMiddleware from 'redux-thunk';
//import App from './App';

const store=createStore(
        parse,
        applyMiddleware(
            thunkMiddleware
        )),
      currentUri=window.location.search,
      uriParams=uriToJson(currentUri);

store.dispatch(setRoute(uriParams))
//ReactDOM.render(<App />, document.getElementById('root'))
ReactDOM.render(<Provider store={store}> <Main /></Provider>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
